function bytesToSize(input, precision)
{
    var unit = ['', 'K', 'M', 'G', 'T', 'P'];
    var index = Math.floor(Math.log(input) / Math.log(1024));
    if (unit >= unit.length) return input + ' B';
    return (input / Math.pow(1024, index)).toFixed(precision) + ' ' + unit[index] + 'B'
}

